 several regions of Dun Morogh - including the great gnome city. In a desperate attempt to destroy the invading troggs, High Tinker Mekkatorque ordered the emergency venting of the city's radioactive waste tanks. Several gnomes sought shelter from the airborne pollutants as they waited for the troggs to die or flee. Unfortunately, though the troggs became irradiated from the toxic assault - their siege continued, unabated. Those gnomes who were not killed by noxious seepage were forced to flee, seeking refuge in the nearby dwarven city of Ironforge. There, High Tinker Mekkatorque set out to enlist brave souls to help his people reclaim their beloved city.\n\nIt is rumored that Mekkatorque's once-trusted advisor, Mekgineer Thermaplug, betrayed his people by allowing the invasion to happen. Now, his sanity shattered, Thermaplug remains in Gnomeregan - furthering his dark schemes and acting as the city's new techno-overlord.",lvl=19,mapID=226,maps={227,228,229}},{n(-17,{q(2904,g({lvl=20,qgs={7850},rwp=40003},{i(9536,{b=1,f=4,rwp=40003}),i(9535,{b=1,f=6,rwp=40003})})),q(2931,{coords={{59.6,67,1442}},isBreadcrumb=1,lvl=25,nextQuests={2930},qgs={4077},r=2,rwp=40003}),q(2842,{coords={{75.6,25.2,1454}},description="You cannot get this quest until you accept the Rig Wars quest. Accept Rig Wars, then this guy gives you the quest to get to Gnomer safely...",lvl=20,qgs={3413},r=1,rwp=40003}),q(2930,g({coords={{70.2,48.4,1455}},lvl=25,qgs={7950},r=2,rwp=40003,sourceQuests={2931}},{qo(1,{providers={{"i",9316}}}),i(9604,{b=1,f=24,rwp=40003}),i(9605,{b=1,f=3,rwp=40003})})),q(2924,g({coords={{68.2,46.2,1455}},lvl=24,qgs={6169},r=2,rwp=40003,sourceQuests={2925}},{qo(1,{providers={{"i",9278}}})})),q(2926,g({coords={{45.8,49.2,1426}},lvl=20,qgs={1268},r=2,rwp=40003,sourceQuests={2927}},{qo(1,{cost={{"i",9283,1}},crs={6329},providers={{"i",9284}}})})),q(2948,g({coords={{36.2,3.8,1455}},cost={{"i",9362,1},{"i",2842,1},{"i",1206,1},{"g",3000}},lvl=28,qgs={6826},r=2,sourceQuests={2947}},{i