 the heart of the Barrens. Dubbed the 'Wailing Caverns', these natural caves were filled with steam fissures which produced long, mournful wails as they vented. Naralex believed he could use the caverns' underground springs to restore lushness and fertility to the Barrens - but to do so would require siphoning the energies of the fabled Emerald Dream.\n\nOnce connected to the Dream, however, the druid's vision somehow became a nightmare. Soon the Wailing Caverns began to change - the waters turned foul and the once-docile creatures inside metamorphosed into vicious, deadly predators. It is said that Naralex himself still resides somewhere inside the heart of the labyrinth, trapped beyond the edges of the Emerald Dream. Even his former acolytes have been corrupted by their master's waking nightmare - transformed into the wicked Druids of the Fang.",lvl=10,mapID=279},{n(-17,g({description="To get to the quest giver hub outside the instance:\n\nWhen facing the mouth of the cave, you should see that the entrance looks like a skull. The questgivers are in the left eye. To get there, climb up the mountain, drop onto the head, drop onto the brow, drop onto the nose, face the instance, and go into the eye on the left"},{q(1487,g({coords={{46,35.7,1413}},lvl=15,qgs={5768},rwp=40003},{qo(1,{providers={{"n",3636}}}),qo(2,{providers={{"n",5755}}}),qo(3,{providers={{"n",5761}}}),qo(4,{providers={{"n",5056}}}),r(7955,{itemID=6476,requireSkill=165,rwp=40003}),i(8071,{b=1,f=27,rwp=40003}),i(6481,{b=1,f=6,rwp=40003})})),q(1486,g({coords={{46,35.7,1413}},lvl=13,qgs={5767},rwp=40003},{qo(1,{providers={{"i",6443}}}),i(6480,{b=1,f=5,rwp=40003}),i(918,{b=1,f=113,rwp=40003})})),q(1489,{coords={{52.3,31.9,1413}},qgs={3448},r=1,rwp=40003,sourceQuests={880}}),q(3370,g({coords={{48.2,32.8,1413}},description="She lives in a house on top of the mountain.",lvl=15,qgs={8418},r=2,rwp=40003,sourceQuests={6981}},{qo(1,{providers={{"i",10649}}}),i(10657,{b=1,f=4,rwp=40003}),i(10658,{b=1,f=6,rwp=40003