 fled to Lordaeron. After the orcs were defeated at the Dark Portal at the end of the Second War, it was decided that the city would be rebuilt. The nobles of Stormwind assembled a team of the most skilled and ingenious stonemasons and architects they could find--which later turned sour and led to the rise of the Defias.\n\nWith the fall of the northern kingdoms, Stormwind is by far the most populated city in the world. It serves in many ways as the cultural and trade center of the Alliance, even with remote access to the sea. It is home to the Academy of Arcane Sciences, the only wizarding school in Eastern Kingdoms, as well as SI:7, a rogue intelligence organization."},{n(-4,{}),n(-8,{faction(72,g({icon="Interface\\Icons\\Achievement_Character_Human_Female",OnTooltip=function(t)	local reputation = t.reputation;	if reputation < 42000 then	local isHuman = _.RaceIndex == 1;	local repPerTurnIn = isHuman and 82.5 or 75;	local x, n = math.ceil((42000 - reputation) / repPerTurnIn), math.ceil(42000 / repPerTurnIn);	GameTooltip:AddDoubleLine("Runecloth Turn Ins", (n - x) .. " / " .. n .. " (" .. x .. ")", 1, 1, 1);	end	end,r=2},{crit(1,{achID=2764,r=2,u=32})}))}),n(-6,{fp(2,{coords={{71,72.5,1453}},crs={352},r=2})}),n(-38,{prof(164,{n(5511,g({coords={{57,16.6,1453}},r=2},{r(9785,{collectible=false,requireSkill=164,rwp=80001}),n(-318,{r(9968,{requireSkill=164}),r(9959,{requireSkill=164}),r(9961,{requireSkill=164}),r(2661,{requireSkill=164}),r(3319,{requireSkill=164}),r(2663,{requireSkill=164}),r(2662,{requireSkill=164}),r(7223,{requireSkill=164}),r(3501,{requireSkill=164}),r(3508,{requireSkill=164}),r(3502,{requireSkill=164}),r(3506,{requireSkill=164}),r(9928,{requireSkill=164}),r(9926,{requireSkill=164}),r(2672,{requireSkill=164}),r(7817,{requireSkill=164}),r(2670,{requireSkill=164}),r(2668,{requireSkill=164}),r(3328,{requireSkill=164}),r(12260,{requireSkill=164}),r(2666,{requireSkill=164}),r(2664,{requireSkill=164}),r(3323,{requireSkill=164}),r(3324,{requireSkill=164}),r(