, evil magic can be felt all through the zone, the trees are all but dead, and very few wildlife and ogres can be found in the zone. Travelers are advised to go through the pass fast, as they might fall to the zone's foreboding magic.\n\nTrivia:\nMedivh, the last Guardian, made Deadwind Pass his final place. The tower of Karazhan to the south served as his bastion until his final days.\n\nThe Karazhan Crypts can be explored by players who kill themselves and traverse the gates as a ghost. The crypt is filled to the brim with disturbing content, the most disturbing being a pool filled with human bodies hanged upside down and roped to chains. This area became known to players as the Upside-Down Sinners.",maps={41,43,44,45,46}},{n(-4,{ach(777,{OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(2697,{maphash="380:365:249:76"}),exp(2562,{maphash="300:245:269:337"}),exp(2561,{maphash="270:270:426:299"})}),n(-2,{n(18255,g({coords={a[168]},u=17},{r(38503,{b=1,itemID=31401,requireSkill=755,u=17}),r(42620,{b=1,itemID=33165,requireSkill=333,u=19}),r(42546,{b=1,itemID=33124,requireSkill=165,u=19}),r(42731,{b=1,itemID=33205,requireSkill=165,u=19}),r(42736,{itemID=33209,requireSkill=171,rwp=50001,u=19}),i(29187,{b=1,lvl=70,u=17}),i(34581,{b=1,f=37,lvl=70,rwp=40001,u=19}),i(34582,{b=1,f=37,lvl=70,rwp=40001,u=19})}))}),n(0,{r(20010,{crs={7372},itemID=16246,requireSkill=333})})})),m(499,g({lore="The Deeprun Tram is a long, fully enclosed, underground (and partially underwater) set of double tracks upon which rolls two sets of three wagons, all credited to the gnomes' technical engineering. The service is fast and smooth, and is provided free of charge to travelers between the Alliance-aligned cities of Ironforge and Stormwind City."},{n(-17,{q(6661,g({lvl=10,qgs={12997},r=2},{qo(1,{crs={13016},providers={{"i",17117}}})})),q(6662,g({cost={{"i",17118,1}},lvl=10,qgs={12997},r=2,sourceQuests={6661}},{i(17119,{