th the curse of the Lich King's plague. The sky over Tirisfal is eternally gloomy and tinted a blighted green, and the trees and other flora desperately cling to their last shreds of life.\n\nAlthough tainted and melancholy, Tirisfal still very much has its own unique, haunting beauty, particularly in such areas as the stony North Coast, the village of Brill, and the deep atmosphere of the ruined Agamand Mills.\n\nTirisfal Glades is home not only to the Forsaken, but to their enemies as well. The Scarlet Crusade has several outposts here, including the seat of their religious faith, the Scarlet Monastery. The minions of the Scourge are also ever present, tainting the derelict farmsteads and dilapidated mills with their foul presence."},{m(465,g({icon="Interface\\Icons\\Achievement_Character_Undead_Female",lore="Deathknell is a small Forsaken village nestled in a well guarded valley just north of Silverpine Forest in Tirisfal Glades which serves as the starting area for the Forsaken."},{n(-17,{q(8,{coords={{38.2,56.6,1420}},providers={{"i",7628}},qgs={6784},r=1,rwp=40003}),q(590,{coords={{38.2,56.6,1420}},qgs={6784},r=1,rwp=40003,sourceQuests=a[216]}),q(3096,{c=a[155],coords={{30.8,66.2,1420}},providers={{"i",9559}},qgs={1569},races=a[174],rwp=70003,sourceQuests={364}}),q(3098,{c=a[216],coords={{30.8,66.2,1420}},providers={{"i",9574}},qgs={1569},races=a[174],rwp=70003,sourceQuests={364}}),q(3097,{c=a[174],coords={{30.8,66.2,1420}},providers={{"i",9569}},qgs={1569},races={5,10},rwp=70003,sourceQuests={364}}),q(5651,{c=a[174],coords={{31.1,66,1420}},lvl=5,qgs={2123},races=a[174],rwp=40003}),q(6395,g({coords={{30.9,66.1,1420}},lvl=3,qgs={1661},r=1,rwp=40003,sourceQuests={376}},{qo(1,{coords={{36.6,61.6,1420},{31,65,1420}},crs={1919},providers={{"i",16333}}})})),q(380,g({coords={{32.2,66,1420}},lvl=2,qgs={1570},r=1,rwp=40003,sourceQuests={376}},{qo(1,{providers={{"n",1504}}}),qo(2,{providers={{"n",1505}}}),i(3270,{b=1,f=4}),i(3273,{b=1,f=6}),i(3272,{b=1,f=5})})),q(1470,{