ind, which can cut through clothing on a blustery day."},{n(-4,{ach(802,{OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(108,{maphash="195:240:442:241"}),exp(113,{maphash="225:256:220:102"}),exp(115,{maphash="280:190:205:467"}),exp(219,{maphash="305:210:204:260"}),exp(922,{maphash="288:235:523:377"}),exp(20,{maphash="220:200:317:331"}),exp(109,{maphash="210:215:387:11"}),exp(917,{maphash="200:240:524:252"}),exp(921,{maphash="200:185:208:375"}),exp(111,{maphash="215:215:307:29"}),exp(107,{maphash="225:210:459:105"}),exp(918,{maphash="225:205:328:148"}),exp(920,{maphash="256:175:339:418"}),exp(916,{maphash="165:200:488:0"})}),n(-6,{fp(4,{coords={{56.6,52.6,1436}},crs={523},r=2})}),n(-17,{q(6181,{coords={{56.9,47.2,1436}},lvl=10,providers={{"i",15998}},qgs={491},races=a[18],rwp=40003}),q(136,{lvl=10,providers={{"i",1357}},rwp=40003}),q(138,{coords={{25.9,47.77,1436}},lvl=10,providers={{"o",35},{"i",1358}},rwp=40003,sourceQuests={136}}),q(139,{coords={{40.5,47.82,1436}},lvl=10,providers={{"i",1361},{"o",36}},rwp=40003,sourceQuests={138}}),q(140,g({coords={{40.62,17.01,1436},{25.97,16.9,1436}},lvl=10,providers={{"i",1362},{"o",34}},rwp=40003,sourceQuests={139}},{i(2842),i(3343,{b=1,f=113}),i(3342,{b=1,f=10}),i(3344,{b=1,f=4})})),q(3861,g({cost={{"i",11109,1}},description="Simply target any Chicken then spam |cFFFFD700/chicken|r at it until it emotes at you. The vendor, Farmer Saldean, sells the Special Chicken Feed you need.",maps={1413,1420,1424,1429,1431,1433,1445,1943},qgs={620},repeatable=1},{p(84,{b=1,itemID=11110,petTypeID=3,spellID=13548})})),q(6281,{coords={{56.4,52.6,1436}},lvl=10,providers={{"i",15998}},qgs={523},races=a[18],rwp=40003,sourceQuests={6181}}),q(1076,{coords={{43.1,80.3,1453}},cost={{"i",5669,1}},lvl=17,qgs={4078},r=2,rwp=40003,sourceQuests={1075}}),q(184,g({lvl=8,maps=a[41],providers={{"i",1972},{"i",1971}},r=2},{i(5057,{f=55,spellID=433}),i(4656,{f=55,spellID=433})})